import { useRouter } from "next/router";
import Markdown from "react-markdown";
import Layout from "../../components/Layout";

export default () => {
  const router = useRouter();

  return (
    <Layout>
      <div className="layout">
        <h1>{router.query.title}</h1>
        <p>
          I feel as if coding is seen as "sexy, sleek, and fun" in today's
          standards. With so many "tech influencers" on social media flexing
          their amazing income, free meals, playing foosball during work, and
          showing off their teslas
        </p>
      </div>
      <style jsx>{`
        h1 {
          font-size: 40px;
          font-weight: 400;
          margin-bottom: 50px;
        }
        .layout {
          padding: 50px 100px 0 100px;
        }
      `}</style>
    </Layout>
  );
};
